import React from 'react'
import Iframe from 'react-iframe';

function Home() {
    return (
        <Iframe url="https://publiccloudgroup.com/"
            width="100%"
            height="100%"
            styles={{ height: "100%", width:'100%' }} />
    )
}

export default Home;
